syntax = "proto3";

package service.v1;

// Group Global Mute
message OidbSvcTrpcTcp0x89A0 {
  uint32 group_uin = 1;
  OidbSvcTrpcTcp0x89A0State state = 2;
}

message OidbSvcTrpcTcp0x89A0State {
  uint32 s = 17;
}

message OidbSvcTrpcTcp0x89A0Response {
  uint32 group_uin = 1;
  optional string error_msg = 2;
}
